import React from "react";

 function CountryComponent(props) {
  const { brand, maker, year, price, color } = props.details;
  return (
    <div>
      <h1>Car details</h1>
      <p>Brand: {brand}</p>
      <p>Maker: {maker}</p>
      <p>Year: {year}</p>
      <p>Price: {price}</p>
      <p>Color: {color}</p>
      <hr />
    </div>
  );
}
export default CountryComponent;
